//Archivo de const con las urls para aguilizar la programacion 
export const home = '/';
export const recipeList = '/organization';
export const recipebyid = '/organization/:id';
export const recipenew = '/organization/new';
export const recipeof = id => '/organization/'+ id;
export const editrecipeof = id => '/organization/'+ id +"/edit";
